import React from 'react';


class Token extends React.Component{

  constructor(props){
    super(props);
    this.state = {
      email : "",
      password : ""
    }
  }



  onChangeHandler = (e)=> {
    this.setState({ [e.target.name] : e.target.value})
  }


  render(){
    return(
      <>

         <h3> {this.state.email} </h3>
       <form>

          <input 
            type = "email"
            name = "email"
            value = {this.state.email}
            onChange = {this.onChangeHandler}
          />


       </form>



      </>
    )
  }

}


export default Token;
